function contains(a,n){for(var s in a)if(a[s].albumName==n)return s;return-1}var app=angular.module("top5app",["firebase"]);app.controller("AppControl",["$scope","$firebase",function(a){a.submissions=[],a.addAlbum=function(){a.submissions.length<=10&&contains(a.submissions,a.albumName)<0&&a.submissions.push({bandName:a.bandName,albumName:a.albumName}),a.bandName="",a.albumName=""}}]);